describe("Ext.data.ResultSet",function(){var C,B=Ext.data.ModelManager,A=Ext.data.ResultSet;beforeEach(function(){Ext.ClassManager.enableNamespaceParseCache=false});afterEach(function(){Ext.ClassManager.enableNamespaceParseCache=true;Ext.data.Model.schema.clear();Ext.undefine("spec.User")});describe("instantiation with records",function(){var D,E,F;beforeEach(function(){Ext.define("spec.User",{extend:"Ext.data.Model",fields:[{name:"name",type:"string"}]});E=new spec.User({name:"nico"});F=new spec.User({name:"flo"});D={records:[E,F]}});it("should have count equal to records.length",function(){C=new A(D);expect(C.getLoaded()).toBe(true);expect(C.getCount()).toEqual(2);expect(C.getTotal()).toBeNull();expect(C.getSuccess()).toBe(false)})});describe("instantiation without records and with a count",function(){var D={count:16};it("should have correct configuration options",function(){C=new A(D);expect(C.getLoaded()).toBe(true);expect(C.getCount()).toEqual(16);expect(C.getTotal()).toBeNull();expect(C.getSuccess()).toBe(false)})})});